import React, { useEffect, useState } from 'react'
import '../styles/Home.css'

// Add the User component
import UserProfile from '../components/user/UserProfile'
import UrlDashBoard from '../components/user/urlDashBoard'

function Home () {
  return (
    <div>
      <UserProfile />
      <UrlDashBoard />
    </div>
  )
}

export default Home
